import React, {useEffect} from 'react'

import Header from '../parts/Header'


export default function Login() {

  useEffect(() => {
    window.scroll(0, 0)
  }, [])

  return (
    <>
      <section className="container mx-auto pt-10">
        <Header onLight></Header>
      </section>
      <section className="container mx-auto pt-10">

      </section>
    </>
  )
}
